sido cng cc cng ty thnh vin. Ngi truy cp c php xem cc ni dung trong trang web, trch dn ni dung bng cch in n, ti v a cng v phn pht cho ngi khc ch vi mc ch phi thng mi.','<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Vic truy cp v&agrave; s dng trang web ca Resido ph thuc v&agrave;o nhng iu khon, iu kin di &acirc;y, v&agrave; lut ph&aacute;p li&ecirc;n quan ca Vit Nam.</span></span></p>\n\n                    <h4 style=\"text-align: justify;\"><span style=\"font-size:18px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>1. Quyn t&aacute;c gi&nbsp;</strong></span></span></h4>\n\n                    <p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Quyn t&aacute;c gi v&agrave; c&aacute;c quyn s hu tr&iacute; tu kh&aacute;c i vi mi vn bn, h&igrave;nh nh, &acirc;m thanh, phn mm v&agrave; c&aacute;c ni dung kh&aacute;c tr&ecirc;n trang web n&agrave;y thuc quyn s hu ca Resido c&ugrave;ng c&aacute;c c&ocirc;ng ty th&agrave;nh vi&ecirc;n. Ngi truy cp c ph&eacute;p xem c&aacute;c ni dung trong trang web, tr&iacute;ch dn ni dung bng c&aacute;ch in n, ti v a cng v&agrave; ph&acirc;n ph&aacute;t cho ngi kh&aacute;c ch vi mc &iacute;ch phi thng mi, cung cp th&ocirc;ng tin hoc mc &iacute;ch c&aacute; nh&acirc;n. Bt k ni dung n&agrave;o t trang web n&agrave;y u kh&ocirc;ng c s dng  b&aacute;n hoc ph&acirc;n t&aacute;n  kim li v&agrave; cng kh&ocirc;ng c chnh sa hoc a v&agrave;o bt k n phm hoc trang web n&agrave;o kh&aacute;c.</span></span></p>\n\n                    <h4 style=\"text-align: justify;\"><span style=\"font-size:18px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>2. Ni dung</strong></span></span></h4>\n\n                    <p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Th&ocirc;ng tin tr&ecirc;n trang web n&agrave;y c bi&ecirc;n son vi s tin tng cao  nhng ch d&agrave;nh cho c&aacute;c mc &iacute;ch nghi&ecirc;n cu th&ocirc;ng tin tng qu&aacute;t. Tuy ch&uacute;ng t&ocirc;i n lc duy tr&igrave; th&ocirc;ng tin cp nht v&agrave; chun x&aacute;c, nhng ch&uacute;ng t&ocirc;i kh&ocirc;ng khng nh hay bo m theo bt k c&aacute;ch thc n&agrave;o v s y , ch&iacute;nh x&aacute;c, &aacute;ng tin cy, th&iacute;ch hp hoc c&oacute; sn li&ecirc;n quan n trang web, hoc th&ocirc;ng tin, sn phm, dch v, hoc h&igrave;nh nh li&ecirc;n quan trong trang web v&igrave; bt c mc &iacute;ch g&igrave;. </span></span></p>\n\n                    <p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Resido v&agrave; mi nh&acirc;n vi&ecirc;n, nh&agrave; qun l&yacute;, v&agrave; c&aacute;c b&ecirc;n i din ho&agrave;n to&agrave;n kh&ocirc;ng chu tr&aacute;ch nhim g&igrave; i vi bt k tn tht, thit hi hoc chi ph&iacute; ph&aacute;t sinh do vic truy cp v&agrave; s dng trang web n&agrave;y v&agrave; c&aacute;c trang web c kt ni vi n&oacute;, bao gm nhng kh&ocirc;ng gii hn, vic mt i li nhun, c&aacute;c khon l trc tip hoc gi&aacute;n tip. Ch&uacute;ng t&ocirc;i cng kh&ocirc;ng chu tr&aacute;ch nhim, hoc li&ecirc;n i tr&aacute;ch nhim nu trang web tm thi kh&ocirc;ng th truy cp do c&aacute;c vn  k thut nm ngo&agrave;i tm kim so&aacute;t ca ch&uacute;ng t&ocirc;i. Mi b&igrave;nh lun, gi &yacute;, h&igrave;nh nh, &yacute; tng v&agrave; nhng th&ocirc;ng tin hay t&agrave;i liu kh&aacute;c m&agrave; ngi s dng chuyn cho ch&uacute;ng t&ocirc;i th&ocirc;ng qua trang web n&agrave;y s tr th&agrave;nh t&agrave;i sn c quyn ca ch&uacute;ng t&ocirc;i, bao gm c c&aacute;c quyn c&oacute; th ph&aacute;t sinh trong tng lai gn lin vi ch&uacute;ng t&ocirc;i.</span></span></p>\n\n                    <p style=\"text-align:center\"><img alt=\"\" src=\"https://flex-home.botble.com/storage/general/copyright.jpg\" style=\"width: 90%;\" /></p>\n\n                    <h4 style=\"text-align: justify;\"><span style=\"font-size:18px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><strong>3. Lu &yacute; c&aacute;c trang web c kt ni</strong></span></span></h4>\n\n                    <p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Ti nhiu im trong trang web, ngi s dng c&oacute; th nhn c c&aacute;c kt ni n c&aacute;c trang web kh&aacute;c li&ecirc;n quan n mt kh&iacute;a cnh c th. iu n&agrave;y kh&ocirc;ng c&oacute; ngha l&agrave; ch&uacute;ng t&ocirc;i c&oacute; li&ecirc;n quan n nhng trang web hay c&ocirc;ng ty s hu nhng trang web n&agrave;y. D&ugrave; ch&uacute;ng t&ocirc;i c&oacute; &yacute; nh kt ni ngi s dng n c&aacute;c trang web cn quan t&acirc;m, nhng ch&uacute;ng t&ocirc;i v&agrave; c&aacute;c nh&acirc;n vi&ecirc;n, nh&agrave; qun l&yacute;, hoc c&aacute;c b&ecirc;n i din ho&agrave;n to&agrave;n kh&ocirc;ng chu tr&aacute;ch nhim hoc li&ecirc;n i chu tr&aacute;ch nhim g&igrave; i vi c&aacute;c trang web kh&aacute;c v&agrave; th&ocirc;ng tin cha ng trong &oacute;.</span></span></p>\n                    <p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">At many points in the website, users can get links to other websites related to a specific aspect. This does not mean that we are related to the websites or companies that own these websites. Although we intend to connect users to sites of interest, we are not responsible or jointly responsible for our employees, managers, or representatives. with other websites and information contained therein.</span></span></p>\n                    '),('vi',16,'Cookie Policy',NULL,'<h3>EU Cookie Consent</h3><p> s dng trang web ny, chng ti ang s dng Cookie v thu thp mt s D liu.  tun th GDPR ca Lin minh Chu u, chng ti cho bn la chn nu bn cho php chng ti s dng mt s Cookie nht nh v thu thp mt s D liu.</p><h4>D liu cn thit</h4><p>D liu cn thit l cn thit  chy Trang web bn ang truy cp v mt k thut. Bn khng th hy kch hot chng.</p><p>- Session Cookie: PHP s dng Cookie  xc nh phin ca ngi dng. Nu khng c Cookie ny, trang web s khng hot ng.</p><p>- XSRF-Token Cookie: Laravel t ng to \"token\" CSRF cho mi phin ngi dng ang hot ng do ng dng qun l. Token ny c s dng  xc minh rng ngi dng  xc thc l ngi thc s a ra yu cu i vi ng dng.</p>');
